export default class GameDto {
    constructor(data) {
        const dateTime = data.date_of_game ? new Date(data.date_of_game) : null;
        this.id = data.id;
        this.lap = data.lap || null;
        this.date = data.date_of_game || null;
        this.time_of_game = data.date_of_game || null;
        this.parametrs = data.parametrs || [];
        this.homeTeam = data.homeTeam || null;
        this.awayTeam = data.awayTeam || null;
        this.supervisor = data.supervisor || null;
        this.referees = data.referees || [];
    }

    getGameSummary() {
        return `${this.homeTeam?.name || 'N/A'} vs ${this.awayTeam?.name || 'N/A'}`;
    }
}
